import {connect} from 'react-redux'
import {
    HomeWrap
} from './style'
class Home extends Component{
    render(){
        return (
            <HomeWrap>
                <HomeTop></HomeTop>
            </HomeWrap>
        )
    }
}
export default connect(null, null)(Home)
